article_content:
깨졌어요 다시보내주세요
상품평 보니까 깨진게 한두개도 아닌데
포장을 조금 더 신경쓰실 생각은 안하시는지;
급하게 써야해서 비싸도 로켓시키는건데 ;;

가격 : 37,430원

더 저렴할때 왜 못샀나 후회가 되는데~
지금은 제가 샀을때보다 만원이나 더올랐네요;;;;
가격변동 엄청 심한 상품인거 같아요~~~
다들 가격 유심히 잘봐두셨다가 3만 5천원 이하로 내려가면 구입하시는게 좋으실거같아요~~
저도 내려가면 더 사려고 기다리고 있거든요ㅎㅎㅎ

제품은 튼튼하니 좋아요^^
전 아이들 장난감이 놀이방에 한가득 굴러다니고있어서
자주 안가지고 노는 것들을 꽉꽉 채워서 정리해 쌓아올려놨어요~

양은 많이 들어가고 좋은것 같아요~~~^^
근데 4만원을 훌쩍 넘는 가격으로 사기에는 좀 비싸지 않나 싶네요;;
뭘 이렇게까지 올리시나;;;;;

♡ 1년이 지난 후기~~~~~♡

가격이 절대 안내리네요;;
참 좋은 상품이긴한데~~1년지난 지금도 아주 잘쓰고있어요~~
내려기는 커녕 작년중순엔 두배정도 오르더니~~
오늘은(2021.17) 또 56,860 원 이네요;;;
이가격으로 정착하려나;;;;;

처음산가격보다 2만원이나 비싸니 선뜻 사기가 망설여지내요;;
